■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>家族の朝に、ちょうどいいいサイズ。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5273/1853bt-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="705" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5273/1853bt-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">トースト4枚、25cmのピザ、グラタン3皿が置ける庫内スペースを確保。また、トーストの焼き上がりを重視し、焼く枚数によって、5本のヒーターを切りかえて使用します。一度に家族分を焼いても、こんがりとおいしく焼き上がります。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">トースト4枚、25cmのピザ、グラタン3皿が置ける庫内スペースを確保。また、トーストの焼き上がりを重視し、焼く枚数によって、5本のヒーターを切りかえて使用します。一度に家族分を焼いても、こんがりとおいしく焼き上がります。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">外形寸法:約39.5×34×22.5cm、トレー内寸:約25.5×25.5cm、庫内寸法:約27×29.5×9cm</font><br><font color="#333333" size="-1">個装サイズ：41×46×29cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">5kg</font><br><font color="#333333" size="-1">個装重量：6000g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><td align="left"><font color="#333333" size="-1">メタリックブラウン(TM)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体:塗装鋼板<br>扉:メッキ鋼板</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">消費電力(W):1300<br>電源コード(m):1.2<br>電源:100V</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書、保証書(1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6--><style type="text/css">
